import "../assets/scss/Contact.scss";
import FadeInSection from "./FadeInSection";

function Contact() {
    const email = () => {
        window.open("mailto:tung.xuan.h@gmail.com", "_blank");
    };
    return (
        <div className="contact">
            <FadeInSection>
                <h2 className="next-step">What's Next?</h2>
                <h2 className="title">Get In Touch</h2>
                <div className="contact-text">
                    Although I’m not currently looking for any new
                    opportunities, my inbox is always open. Whether you have a
                    question or just want to say hi, I’ll try my best to get
                    back to you!
                </div>
                <div className="container-button" onClick={email}>
                    Say Hello
                </div>
            </FadeInSection>
        </div>
    );
}

export default Contact;
